import React from 'react';
import { Chart as ChartJS, ArcElement, Tooltip, Legend } from 'chart.js';
import { Pie } from 'react-chartjs-2';
import './app.css'

ChartJS.register(ArcElement, Tooltip, Legend);

export const data = {
  labels: ['Renda Fixa', 'Renda Variável', 'Arrojado'],
  datasets: [
    {
      label: `invista aqui %`,
      data: [10,30, 60],
      backgroundColor: [
        'rgba(255, 99, 132, 0.2)',
        'rgba(54, 162, 235, 0.2)',
        'rgba(255, 206, 86, 0.2)',
      ],
      borderColor: [
        'rgba(255, 99, 132, 1)',
        'rgba(54, 162, 235, 1)',
        'rgba(255, 206, 86, 1)',
      ],
      borderWidth: 1,
    },
  ],
};

export default function App() {
  return <Pie data={data} />;
}
